import React, {useContext, useEffect, useState} from "react";
import "./asset.style.css";
import {AssetContext} from "../../../../context";
import axios from "axios";

const Asset = () => {
  const {asset, setAsset} = useContext(AssetContext);
  const [today, setToday] = useState(new Date());

  useEffect(() => {
    axios
      .get(`http://localhost:8080/assets/holdingCount/${JSON.parse(sessionStorage.getItem("logined_user")).userId}`)
      .then((response) => {
        setAsset(response.data.holdingCount);
        console.log(response.data.holdingCount[0]);
      })
      .catch((error) => {
        throw error;
      });
  }, []);

  return (
    <div>
      <div className="asset_title_section">
        <div className="my_asset_title"> 내 자산총액</div>
        <div className="today">{today.toLocaleDateString}</div>
      </div>

      <div className="my_money">{asset[0] && asset[0].totalAsset} 원</div>
      <div>
        <div className="money">
          <span>평가 수익률</span>
          <span> : 23.54 %</span>
        </div>

        <div className="money">
          <span>평가 손익</span>
          <span className="won"> : {asset[0] && asset[0].totalProfit} 원</span>
        </div>
      </div>
    </div>
  );
};

export default Asset;
